  Actual Evapotranspiration Rasters calculated using the Simplified-Surface-Energy-Balance
  (SSEB) Model from April 2000 to December 2009 for the High Plains Aquifer in Parts
  of Colorado, Kansas, Nebraska, New Mexico, Oklahoma, South Dakota, Texas, and Wyoming\",\n\t\"tracking_summary\":
