  [],\n\t\"revision_timestamp\": \"2014-09-02T23:00:51.081432\",\n\t\"name\": \"ds-777-monthly-actual-evapotranspiration-rasters-calculated-using-the-simplified-surface-energy\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Estimates of evapotranspiration (ET) are
  an essential component for understanding the water budget of the High Plains aquifer.
  The amount of ET that occurs is a function of crop type, crop management practices,
  soil characteristics, and climate conditions. These raster ET data represent monthly
  actual ET of the High Plains aquifer from April 2000 to December 2009. These data
  were developed using the Simplified-Surface-Energy-Balance (SSEB) model (Senay and
  others, 2007) and then processed using a Geographic Information System (GIS). The
  GIS software used to process these data was Environmental Systems Research Institute
  (ESRI, Inc.) ArcDesktop 9.3.1.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
